#include <cstdio>
#include <cstdlib>
#include <Windows.h>
#include "Video.h"

unsigned int Video::UintDivideEx(unsigned int a, unsigned int b)
{
	unsigned int temp = 1;
	unsigned int result = 0;

	while (b <= a)
	{
		b <<= 1;
		temp <<= 1;
	}

	while (temp > 1)
	{
		b >>= 1;
		temp >>= 1;

		if (a >= b)
		{
			a -= b;
			result += temp;
		}
	}

	return result;
}

void Video::PrintBuffer(unsigned int frame)
{
	unsigned int number = frame + 1;
	unsigned int titleCommandLength;

	for (titleCommandLength = 0; number > 0; number = UintDivideEx(number, 10), titleCommandLength++);

	titleCommandLength += 40;

	char* titleCommand = new char[titleCommandLength];

	memset(titleCommand, 0, titleCommandLength);
	sprintf_s(titleCommand, titleCommandLength, "title Christmas - 2022-12-25 (Frame : %d)", frame);
	system(titleCommand);

	delete[] titleCommand;

	for (short y = 0; y < 40; y++)
	{
		for (short x = 0; x < 160; x++)
		{
			Gotoxy(x, y);

			printf("%c", buffer[x + y * 160 + frame * 6400]);
		}
	}
}

void Video::Wait(unsigned long long milliseconds)
{
	MSG message;

	unsigned long long time0 = GetTickCount64();
	unsigned long long time1;
	unsigned long long different;

	while (true)
	{
		time1 = GetTickCount64();

		if (time0 <= time1)
		{
			different = time1 - time0;
		}
		else
		{
			different = 0xffffffffffffffff - time0 + time1;
		}

		if (different > milliseconds)
		{
			break;
		}

		while (PeekMessage(&message, NULL, 0, 0, PM_REMOVE))
		{
			TranslateMessage(&message);

			DispatchMessage(&message);
		}

		Sleep(1);
	}
}

