Video::~Video()
{
	delete[] buffer;
}

void Video::Play(unsigned int fps)
{
	if (!buffer)
	{
		return;
	}

	const unsigned long long waitMilliseconds = UintDivideEx(1000, fps);

	for (unsigned int frame = 0; frame < MAX_FRAME; frame++)
	{
		PrintBuffer(frame);
		Wait(waitMilliseconds);
	}
}